Описание: Spark Pro Full Black - это стильный и функциональный корпус для компьютера, который подойдет для сборки мощной игровой или офисной системы. Он имеет Mid-Tower форм-фактор, выполнен из стали и стекла и поддерживает установку материнских плат форм-фактора ATX, Micro-ATX, Mini-ITX. Корпус ATX и имеет расположение блока питания сбоку. Он оснащен удобным интерфейсом с портами ATX, AUX, USB, включая USB 3.2 х 2 шт. (TYPE A х 1 шт. + TYPE C х 1 шт.). Корпус не имеет встроенного блока питания, но предусматривает установку до трех вентиляторов диаметром 120 или 140 мм в верхней и нижней частях, а также одного вентилятора диаметром 120 мм на задней панели. Он также обладает дополнительными опциями, такими как максимальная глубина каналов для укладки кабелей 34 мм. Габариты корпуса составляют 41.3 см в длину, 20.4 см в ширину и 39.8 см в высоту. Вес корпуса без упаковки - 5 кг, с упаковкой - 6.3 кг. В комплектацию входит корпус с боковой крышкой из закаленного стекла и верхняя крышка со встроенным пылевым фильтром. Производство - Китай, гарантийный срок - 1 год. Размеры упаковки: 47 см в длину, 28 см в ширину и 48 см в высоту. 

